eval("module.exports = {\"entityMap\":{\"0\":{\"type\":\"IMAGE\",\"mutability\":\"IMMUTABLE\",\"data\":{\"src\":\"/public/images/2017expbudget.png\",\"alignment\":\"right\"}},\"1\":{\"type\":\"LINK\",\"mutability\":\"MUTABLE\",\"data\":{\"url\":\"http://local.link/explorer\"}}},\"blocks\":[{\"key\":\"7g29s\",\"text\":\"What the City of Toronto does\",\"type\":\"header-two\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"5e8do\",\"text\":\" \",\"type\":\"atomic\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[{\"offset\":0,\"length\":1,\"key\":0}],\"data\":{}},{\"key\":\"ngno\",\"text\":\"After you take away the administrative portion of city work, the rest is divided more or less evenly between general city services, and resident support services. The budget and audited financial statements paint slightly different, but similar pictures.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":109,\"length\":21,\"style\":\"BOLD\"},{\"offset\":136,\"length\":25,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"2relu\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"81grd\",\"text\":\"The 2017 budget is shown in the chart. We've learned that budget documents aren't very accurate, but they give a good general idea of what's going on.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"shg8\",\"text\":\"General City Services ($4.9B, 24,000 staff) consists of Transportation (Roads & TTC), Utilities (Water and Waste), and City Commons (Parks, Library, and City-owned destinations)\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":21,\"style\":\"ITALIC\"},{\"offset\":0,\"length\":21,\"style\":\"BOLD\"},{\"offset\":56,\"length\":14,\"style\":\"BOLD\"},{\"offset\":86,\"length\":9,\"style\":\"BOLD\"},{\"offset\":119,\"length\":12,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"1k2bt\",\"text\":\"Resident Support Services ($4.7B, 21,000 staff) consists of Human Services (income, housing, and child support), Protective Services (police, fire, and paramedics), and Health Services (Public Health & Long Term Care)\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":25,\"style\":\"BOLD\"},{\"offset\":60,\"length\":14,\"style\":\"BOLD\"},{\"offset\":113,\"length\":19,\"style\":\"BOLD\"},{\"offset\":169,\"length\":15,\"style\":\"BOLD\"},{\"offset\":0,\"length\":25,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"et4li\",\"text\":\"Administrative Services ($2.7B, 6,500 staff) is what you would normally think of as City Hall work ($1.1B), and also includes Capital Account (financing) activities ($1.6B).\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":23,\"style\":\"BOLD\"},{\"offset\":84,\"length\":9,\"style\":\"BOLD\"},{\"offset\":126,\"length\":15,\"style\":\"BOLD\"},{\"offset\":0,\"length\":23,\"style\":\"ITALIC\"},{\"offset\":143,\"length\":9,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"7ici5\",\"text\":\"For detailed information, see our explorer. Recent budgets have been deliberately guided by a 'status quo' mentality.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[{\"offset\":34,\"length\":8,\"key\":1}],\"data\":{}},{\"key\":\"bhou4\",\"text\":\"Capital projects\",\"type\":\"header-three\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"i8bt\",\"text\":\"Toronto also budgets about $3B in capital projects (building and upgrading things) each year, although it only manages to implement about 2/3 of that. The largest spender is the TTC.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}]};\n\n//# sourceURL=webpack:///./ts/model/data/draft/citybasics.json?");

