eval("module.exports = {\"entityMap\":{\"0\":{\"type\":\"LINK\",\"mutability\":\"MUTABLE\",\"data\":{\"url\":\"https://www.toronto.ca/legdocs/mmis/2017/bu/comm/communicationfile-69341.pdf\"}},\"1\":{\"type\":\"LINK\",\"mutability\":\"MUTABLE\",\"data\":{\"url\":\"http://app.toronto.ca/tmmis/viewAgendaItemHistory.do?item=2017.BU32.7\"}},\"2\":{\"type\":\"LINK\",\"mutability\":\"MUTABLE\",\"data\":{\"url\":\"http://www.socialplanningtoronto.org/citybudgetwatch\"}},\"3\":{\"type\":\"LINK\",\"mutability\":\"MUTABLE\",\"data\":{\"url\":\"http://www.socialplanningtoronto.org/citybudgetwatch_blog\"}},\"4\":{\"type\":\"LINK\",\"mutability\":\"MUTABLE\",\"data\":{\"url\":\"http://www.commitmentto.com/\"}}},\"blocks\":[{\"key\":\"51f58\",\"text\":\"Social Planning Toronto\",\"type\":\"header-two\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"afjka\",\"text\":\"A great example of Civil Society intervention is this: On May 11, 2017, Social Planning Toronto presented an open letter to the Budget Committee meeting, requesting that unfunded social programs, already approved by Council, be costed. They provided a partial list:\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[{\"offset\":109,\"length\":11,\"key\":0},{\"offset\":128,\"length\":24,\"key\":1}],\"data\":{}},{\"key\":\"bvc8l\",\"text\":\"TO Prosperity: Poverty Reduction Strategy\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"7re5s\",\"text\":\"Fair (Transit) Pass Program\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"8c6ca\",\"text\":\"Toronto Strong Neighbourhoods Strategy\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"7kfd3\",\"text\":\"Youth Equity Strategy\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"3vetf\",\"text\":\"Seniors Strategy\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"ahkak\",\"text\":\"Toronto Newcomer Strategy\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"qra9\",\"text\":\"Housing Opportunities Toronto\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"cmc55\",\"text\":\"Recreation Services Plan\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"64run\",\"text\":\"Childcare Growth Strategy\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"f3vpb\",\"text\":\"Transform TO: Climate Action for a Healthy, Equitable, Prosperous Toronto\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"dkk4r\",\"text\":\"Middle Childhood Strategy\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"c6t2k\",\"text\":\"Some 90 Civil Society organizations in Toronto signed the letter.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"8sk1u\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"2vntd\",\"text\":\"This makes complete sense; an analog to the backlog of capital projects. Indeed Councillor Carroll put forward a successful motion to have this done.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"a3l7q\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"cn18v\",\"text\":\"Indeed Social Planning Toronto maintains a blog called City Budget Watch (also here), and a website dedicated to community action (commitmentto.com). They run many budget town halls around the City every year.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":55,\"length\":18,\"style\":\"ITALIC\"}],\"entityRanges\":[{\"offset\":55,\"length\":17,\"key\":2},{\"offset\":79,\"length\":4,\"key\":3},{\"offset\":131,\"length\":16,\"key\":4}],\"data\":{}},{\"key\":\"eofne\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}]};\n\n//# sourceURL=webpack:///./ts/model/data/draft/civilsociety.json?");

