eval("module.exports = {\"entityMap\":{\"0\":{\"type\":\"LINK\",\"mutability\":\"MUTABLE\",\"data\":{\"url\":\"http://www.betterbudget.ca/\"}},\"1\":{\"type\":\"LINK\",\"mutability\":\"MUTABLE\",\"data\":{\"url\":\"http://www.betterbudget.ca/wp-content/uploads/2015/05/Review-of-the-Budget-Process-2015.pdf\"}},\"2\":{\"type\":\"IMAGE\",\"mutability\":\"IMMUTABLE\",\"data\":{\"src\":\"/public/images/newyorkbudgetcycle2015.png\",\"width\":95,\"alignment\":\"center\"}}},\"blocks\":[{\"key\":\"9knbd\",\"text\":\"New York Budget Roadmap\",\"type\":\"header-two\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"9d68b\",\"text\":\"In May of 2015 Better Budget Toronto created a review of the Toronto budget process in a paper titled Putting the public back in public budgeting: Review of the 2015 Toronto budget process. The paper reviews Toronto's budget process from the point of view of Participation, Accessibility, Vision, and The Use of Evidence. Worth a read.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":102,\"length\":86,\"style\":\"ITALIC\"},{\"offset\":259,\"length\":13,\"style\":\"ITALIC\"},{\"offset\":274,\"length\":13,\"style\":\"ITALIC\"},{\"offset\":289,\"length\":6,\"style\":\"ITALIC\"},{\"offset\":301,\"length\":19,\"style\":\"ITALIC\"}],\"entityRanges\":[{\"offset\":15,\"length\":21,\"key\":0},{\"offset\":102,\"length\":86,\"key\":1}],\"data\":{}},{\"key\":\"8uvk1\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"64rq3\",\"text\":\"In that paper, one of the intersting pieces of evidence presented is the budget process used (at the time) by New York City. It's worth a review to get a sense of alternative processes that can be applied to budgeting. This is systematic, starts from the ground up, and extensive. Of course New York is several times the size of Toronto, but there are still good ideas to be had here.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"3mh3j\",\"text\":\" \",\"type\":\"atomic\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[{\"offset\":0,\"length\":1,\"key\":2}],\"data\":{}},{\"key\":\"ec0bt\",\"text\":\"Examples like this are worth studying to see how we can improve our own process.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"8m4nh\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"con7s\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"eqkc6\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}]};\n\n//# sourceURL=webpack:///./ts/model/data/draft/elsewhere.json?");

